import React from 'react';
import './App.css';
import WeatherList from './Components/WeatherList';
import {Routes, Route} from 'react-router-dom'
import Weather from './Components/Weather';

function App() {

  const weatherInfo = [
    {day: "Sun Nov 27", degrees: "10", status:"cloudy"},
    {day: "Mon Nov 28", degrees: "9", status:"sunny"},
    {day: "Tue Nov 29", degrees: "5", status:"sunny"},
    {day: "Wed Nov 30", degrees: "12", status:"rainy"},
    {day: "Thu Nov 31", degrees: "1", status:"sunny"},
  ];

  return (
    <div className="appWrapper">
      <Routes>
        <Route path='/' element={<WeatherList weatherInfo={weatherInfo} />} />
        <Route path='/weather' element={<Weather />} />
      </Routes>
      {/* <div className='weatherListWrapper'>
        <WeatherList weatherInfo={weatherInfo} />
      </div> */}
    </div>
  );
}

export default App;
